import './Slide.css';
import Banner from "./Banner/Banner";

export default function Header() {
    return (
        <section className='slide'>
            <div className='slide_tool'>
            <Banner />
            </div>
            <div className='slide_form'>
                <div className='form_input'>

                </div>

                <div className='form_submit'>

                </div>
            </div>
        </section>
    )
}
